import React from 'react';
import Aux from '../../../Hoc/Aux/Aux';

const Receipt = (props) => (
    <Aux>
        <div className="ReceiptCardContainer">
                Shop: {props.location}
                Item: {props.item}
                Date: {props.date}
                Price: {props.price}
        </div>
    </Aux>
    );

export default Receipt;
